import React from 'react';

class ContentSignUp extends React.Component{
  render(){
    return(
      <div className="text-center">
         <button className="btn" type="button" data-toggle="collapse" data-target=".multi-collapse" aria-expanded="false" aria-controls="multiCollapse1 multiCollapse2">Business Customer</button>
          <div class="collapse show multi-collapse" id="multiCollapse1">
            <div class="card card-body">

            </div>
          </div>

          <div class="collapse multi-collapse" id="multiCollapse2">
            <div class="card card-body">
            </div>
          </div>
          </div>


    )
  }
}
export default ContentSignUp
